import React from 'react';
import federation from '../../images/brands/raco_federation.png';
import mkt from '../../images/brands/raco_mkt.png';
import events from '../../images/brands/raco_events.png';
import consulting from '../../images/brands/raco_consulting.png';
import athletes from '../../images/brands/raco_athletes.png';
import global from '../../images/brands/raco_global.png';
import './OurServices.css'; // Import CSS file for styling

const OurServices = () => {

  return (
    <>
      <div className="services-container">
        <div className="skewed-section"></div>
        <h1 className="section-title">Nuestros Servicios</h1>  
        <div className="services-logo-container">
          <div>
            <img src={federation} alt="Logo" className="brand-logo" style={{ animationName: 'fadeIn1', animationDuration: '1s', animationDelay: '0s' }} /> 
          </div>
          <div>
            <img src={mkt} alt="Logo" className="brand-logo" style={{ animationName: 'fadeIn1', animationDuration: '1s', animationDelay: '0.5s' }} /> 
          </div>
          <div>
            <img src={events} alt="Logo" className="brand-logo" style={{ animationName: 'fadeIn1', animationDuration: '1s', animationDelay: '1s' }} /> 
          </div>
          <div>
            <img src={athletes} alt="Logo" className="brand-logo" style={{ animationName: 'fadeIn1', animationDuration: '1s', animationDelay: '1.5s' }} /> 
          </div>
          <div>
            <img src={consulting} alt="Logo" className="brand-logo" style={{ animationName: 'fadeIn1', animationDuration: '1s', animationDelay: '2s' }} /> 
          </div>
          <div>
            <img src={global} alt="Logo" className="brand-logo" style={{ animationName: 'fadeIn6', animationDuration: '1s', animationDelay: '2.5s' }} /> 
          </div>
        </div>
      </div>
    </>
  );
};

export default OurServices;
